  false,\n\t\"url\": null,\n\t\"notes\": \"The Advanced Spaceborne Thermal Emission
  and Reflection Radiometer (ASTER) is an advanced multispectral imager that was launched
  on board NASA's Terra spacecraft in December, 1999. The ASTER Level-1B data are
  L1A data with the radiometric and geometric coefficients applied. All of these data
  are stored together with metadata in one HDF file. The L1B image is projected onto
  a rotated map (rotated to path oriented coordinate) at full instrument resolutions.
  The Level-1B data generation also includes registration of the SWIR and TIR data
  to the VNIR data. And in addition, for SWIR in particular, the parallax errors due
  to the spatial locations of all of its bands are corrected. The Level-1B data set
  provides scaled or calibrated radiance values, and is the input for most of the
  higher-level products.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
